import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() { 
        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
          };
        return (  
        <Slider {...settings}>
            <div>
              <img src="assets/images/bg1.jpg" />
            </div>
            <div>
            <img src="assets/images/bg2.jpg" />
            </div>
            <div>
              <h3>3</h3>
            </div>
          </Slider>
          );
    }
}

export default HeroCarousel;
